//paper

function render_paper(paper_data){
  var paper_container = $("#paper_container")
  paper_container.find(".paper-title").text(paper_data.title==undefined?"":paper_data.title)
  paper_container.find(".paper-authors").text(paper_data.author==undefined?"":paper_data.author)
  paper_container.find(".paper-year").text(paper_data.year==undefined?"":paper_data.year)
  // paper_container.find(".paper-ref").text(paper_data.ref==undefined?"":paper_data.ref)
  paper_container.find(".paper-venue").text(paper_data.venue==undefined?"":paper_data.venue)
  paper_container.find(".paper-abstract").text(paper_data.abstract==undefined?"":paper_data.abstract)
}
async function init_paper(){
  var paper_data  = await http.getPaper()
  httpCache.paper = paper_data
  render_paper(paper_data)
}
init_paper()


// matrix

var about_string = '';



function render_matrix(matrix_data){
  // define arguments object
  var args = {
      root: '#container-id-1',
      'network_data': matrix_data,
      // 'about':about_string,
      'row_tip_callback':row_tip_callback,
      'col_tip_callback':col_tip_callback,
      'tile_tip_callback':tile_callback,
      'dendro_callback':dendro_callback,
      'matrix_update_callback':matrix_update_callback,
      'cat_update_callback': cat_update_callback,
      'sidebar_width':150,
      'super_label_scale':0,
      'row_label_scale':0.1,
      'col_label_scale':0.5,
      'ini_expand':true,
      'show_label_tooltips':false
      // 'use_sidebar':false
      // 'ini_view':{'N_row_var':20}
      // 'ini_expand':true
  };

  resize_container(args);

  d3.select(window).on('resize',function(){
  resize_container(args);
  cgm.resize_viz();
  });

  cgm = Clustergrammer(args);

  d3.select(cgm.params.root + ' .wait_message').remove();

}

function matrix_update_callback(){

if (genes_were_found[this.root]){
  enr_obj[this.root].clear_enrichr_results(false);
}
}

function cat_update_callback(){
console.log('callback to run after cats are updated');
}

function tile_callback(tile_data){
var row_name = tile_data.row_name;
var col_name = tile_data.col_name;
}
function row_tip_callback(root_tip,row_info){
console.log(root_tip, row_info)
}

function col_tip_callback(col_data){
console.log(col_data)
}

function dendro_callback(inst_selection){

var inst_rc;
var inst_data = inst_selection.__data__;

// toggle enrichr export section
if (inst_data.inst_rc === 'row'){
  d3.select('.enrichr_export_section')
    .style('display', 'block');
} else {
  d3.select('.enrichr_export_section')
    .style('display', 'none');
}

}

function resize_container(args){

var container_width = $("#matrix_container").width();
var screen_height = window.innerHeight - 20;

d3.select(args.root)
  .style('width', container_width+'px')
  .style('height', screen_height+'px');
}

async function init_matrix() {
  var matrix_data = await http.getMatrix()
  httpCache.matrix = matrix_data
  render_matrix(matrix_data)
}
init_matrix()

