function render_ref(ref_data) {
  $("#ref_container").find(".ref_list").hide(500)
  var html = ""
  for(var ref of ref_data){
    html+=`
      <div class="ref_instance">
        <div class="ref_short">
          <h4>${ref.title.length>60?ref.title.slice(0,60)+"...":ref.title}</h4>
          <p>${ref.authors.length>30?ref.authors.slice(0,30)+"...":ref.authors}<span style="float: right;">${ref.year}</span></p>
        </div>
        <div class="ref_detail" style="display:none">
          <h4>${ref.title}</h4>
          <p>${ref.authors}</p>
          <p>${ref.year}</p>
          ${ref.venue==""?"":"<p>"+ref.venue+"</p>"}
          <p><a target="_blank" class="ref-btn btn btn-default paper-details" href="${'http://www.bing.com'}" role="button">Paper details <i class="fa fa-external-link" aria-hidden="true"></i></a></p>
        </div>
      </div>
    `
  }
  $("#ref_container").find(".ref_list").html(html)
  $("#ref_container").find(".ref_list").show(1300)
  $('.ref_short').unbind("click")
  $('.ref_detail').unbind("click")
  $(".ref_short").click(function(){
    $(this).hide().siblings().show()
  })
  $(".ref_detail").click(function(){
    $(this).hide().siblings().show()
  })
  $(".ref-btn").click(function(event){
    event.stopPropagation()
  })
}
async function init_ref() {
  var ref_data = await http.getRef()
  httpCache.ref = ref_data
  var order_list = cgm.params.matrix.orders[ cgm.params.viz.inst_order.row + '_row' ]
  var col_name_list = []
  for(var order of order_list){
    col_name_list.push(cgm.params.inst_nodes.col_nodes[order].name)
  }
  // 
  matrixFront.col_reorder_callback(col_name_list)
  // render_ref(ref_data)
  // ref
  $(".ref-search-btn").click(function(){
    var search_content = $(".ref-search-input").val().toLowerCase()
    var search_result = []
    if (httpCache.ref != null){
      if(search_content.trim()!=""){
        for(var ref of httpCache.ref){
          for(var key in ref){
            if(ref[key].toLowerCase().search(search_content)!=-1){
              search_result.push(ref)
              break
            }
          }
        }
        render_ref(search_result)
      }else{
        render_ref(httpCache.ref)
      }
    }
  })
}
init_ref()

//
function col_reorder_callback(col_name_list){
var temp_ref = []
//paper
var temp_row = []
httpCache.ref.forEach(ref => {
  var col_name = ref.cid
  var index = col_name_list.indexOf(col_name)
  if (index!=-1){
    temp_ref[index] = ref
  }else{
    temp_row.push(ref)
  }
})
render_ref(temp_ref)
}